import React from 'react';
import {
  Box,
  Typography,
  TextField,
  Button,
  Grid,
  Snackbar,
  Alert,
  Checkbox,
  FormControlLabel,
  InputAdornment,
  IconButton,
  LinearProgress
} from '@mui/material';
import { Visibility, VisibilityOff } from '@mui/icons-material';
import AgricultureIcon from '@mui/icons-material/Agriculture';
import EmailIcon from '@mui/icons-material/Email';
import PhoneAndroidIcon from '@mui/icons-material/PhoneAndroid';
import BadgeIcon from '@mui/icons-material/Badge';

export default function RegistroAgricola() {
  const [formData, setFormData] = React.useState({
    nombre: '',
    identificacion: '',
    celular: '',
    correo: '',
    contraseña: '',
    confirmar: '',
    aceptaPolitica: false
  });
  const [mostrarClave, setMostrarClave] = React.useState(false);
  const [errores, setErrores] = React.useState({});
  const [registroExitoso, setRegistroExitoso] = React.useState(false);

  const validar = () => {
    const nuevosErrores = {};
    const correoRegex = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;
    const telefonoRegex = /^[0-9]{7,}$/;

    if (!formData.nombre.trim()) nuevosErrores.nombre = 'Por favor, ingresa tu nombre completo.';
    if (!formData.identificacion.trim()) nuevosErrores.identificacion = 'Ingresa tu número de identificación.';
    if (!formData.celular || !telefonoRegex.test(formData.celular)) nuevosErrores.celular = 'Número de celular no válido.';
    if (!formData.correo || !correoRegex.test(formData.correo)) nuevosErrores.correo = 'Correo electrónico inválido.';
    if (!formData.contraseña || formData.contraseña.length < 6) nuevosErrores.contraseña = 'La contraseña debe tener al menos 6 caracteres.';
    if (formData.confirmar !== formData.contraseña) nuevosErrores.confirmar = 'Las contraseñas no coinciden.';
    if (!formData.aceptaPolitica) nuevosErrores.aceptaPolitica = 'Debes aceptar la política de privacidad.';

    setErrores(nuevosErrores);
    return Object.keys(nuevosErrores).length === 0;
  };

  const evaluarFortaleza = (clave) => {
    if (clave.length >= 10 && /[A-Z]/.test(clave) && /\d/.test(clave)) return 100;
    if (clave.length >= 8 && /\d/.test(clave)) return 60;
    if (clave.length >= 6) return 30;
    return 10;
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (validar()) {
      setRegistroExitoso(true);
      setTimeout(() => window.location.href = '/inicio', 3000);
    }
  };

  return (
    <Box sx={{ maxWidth: 600, mx: 'auto', mt: 6, bgcolor: 'white', borderRadius: 4, p: 4, boxShadow: 3 }}>
      <Typography variant="h4" sx={{ fontWeight: 'bold', color: '#2e7d32', mb: 1, textAlign: 'center' }}>
        🌾 Registro para Agricultores
      </Typography>
      <Typography variant="subtitle1" sx={{ textAlign: 'center', mb: 3 }}>
        Únete a nuestra comunidad agrícola digital. ¡Te ayudamos a crecer con tecnología!
      </Typography>

      <form onSubmit={handleSubmit}>
        <Grid container spacing={2}>
          <Grid item xs={12}>
            <TextField
              label="Nombre y Apellido"
              fullWidth
              value={formData.nombre}
              onChange={(e) => setFormData({ ...formData, nombre: e.target.value })}
              error={!!errores.nombre}
              helperText={errores.nombre}
              InputProps={{
                startAdornment: (
                  <InputAdornment position="start">
                    <AgricultureIcon color="success" />
                  </InputAdornment>
                )
              }}
            />
          </Grid>

          <Grid item xs={12}>
            <TextField
              label="Número de Identificación"
              fullWidth
              value={formData.identificacion}
              onChange={(e) => setFormData({ ...formData, identificacion: e.target.value })}
              error={!!errores.identificacion}
              helperText={errores.identificacion}
              InputProps={{
                startAdornment: (
                  <InputAdornment position="start">
                    <BadgeIcon color="success" />
                  </InputAdornment>
                )
              }}
            />
          </Grid>

          <Grid item xs={12}>
            <TextField
              label="Número de Celular"
              fullWidth
              value={formData.celular}
              onChange={(e) => setFormData({ ...formData, celular: e.target.value })}
              error={!!errores.celular}
              helperText={errores.celular}
              InputProps={{
                startAdornment: (
                  <InputAdornment position="start">
                    <PhoneAndroidIcon color="success" />
                  </InputAdornment>
                )
              }}
            />
          </Grid>

          <Grid item xs={12}>
            <TextField
              label="Correo Electrónico"
              fullWidth
              value={formData.correo}
              onChange={(e) => setFormData({ ...formData, correo: e.target.value })}
              error={!!errores.correo}
              helperText={errores.correo}
              InputProps={{
                startAdornment: (
                  <InputAdornment position="start">
                    <EmailIcon color="success" />
                  </InputAdornment>
                )
              }}
            />
          </Grid>

          <Grid item xs={12}>
            <TextField
              label="Contraseña"
              type={mostrarClave ? 'text' : 'password'}
              fullWidth
              value={formData.contraseña}
              onChange={(e) => setFormData({ ...formData, contraseña: e.target.value })}
              error={!!errores.contraseña}
              helperText={errores.contraseña || 'Mínimo 6 caracteres'}
              InputProps={{
                endAdornment: (
                  <InputAdornment position="end">
                    <IconButton onClick={() => setMostrarClave(!mostrarClave)} edge="end">
                      {mostrarClave ? <VisibilityOff /> : <Visibility />}
                    </IconButton>
                  </InputAdornment>
                )
              }}
            />
            <LinearProgress
              variant="determinate"
              value={evaluarFortaleza(formData.contraseña)}
              sx={{ mt: 1, height: 8, borderRadius: 5 }}
              color="success"
            />
          </Grid>

          <Grid item xs={12}>
            <TextField
              label="Confirmar Contraseña"
              type="password"
              fullWidth
              value={formData.confirmar}
              onChange={(e) => setFormData({ ...formData, confirmar: e.target.value })}
              error={!!errores.confirmar}
              helperText={errores.confirmar}
            />
          </Grid>

          <Grid item xs={12}>
            <FormControlLabel
              control={
                <Checkbox
                  checked={formData.aceptaPolitica}
                  onChange={(e) => setFormData({ ...formData, aceptaPolitica: e.target.checked })}
                  color="success"
                />
              }
              label={
                <Typography variant="body2">
                  Acepto la{' '}
                  <a href="#" style={{ color: '#2e7d32', fontWeight: 'bold', textDecoration: 'underline' }}>
                    Política de Privacidad
                  </a>{' '}
                  y el tratamiento de mis datos.
                </Typography>
              }
            />
            {errores.aceptaPolitica && (
              <Typography variant="caption" color="error">
                {errores.aceptaPolitica}
              </Typography>
            )}
          </Grid>

          <Grid item xs={12}>
            <Button
              type="submit"
              variant="contained"
              color="success"
              fullWidth
              sx={{ fontWeight: 'bold', py: 1.5, fontSize: '1rem' }}
            >
              🌱 Crear mi cuenta como agricultor
            </Button>
          </Grid>
        </Grid>
      </form>

      <Snackbar
        open={registroExitoso}
        autoHideDuration={4000}
        onClose={() => setRegistroExitoso(false)}
        anchorOrigin={{ vertical: 'top', horizontal: 'center' }}
      >
        <Alert severity="success" variant="filled" onClose={() => setRegistroExitoso(false)}>
          ¡Registro exitoso! Redirigiendo a la plataforma...
        </Alert>
      </Snackbar>
    </Box>
  );
}
